import React from 'react'
import axios from 'axios'
import { View } from 'react-native';

const Games = () => {

    axios.get('https://zelda.fanapis.com/api/games')
        .then(response => {
            console.log(response.data);
        })
        .catch(error => {
            console.log(error);
        });

    return (
        <View>
            <h1>Home works!</h1>
        </View>
    )
}

export default Games
